import React from "react";
import { styled } from "@mui/system";
import "../../shared/UI/css/OrganizationsAndSubjects.css";

const Wrapper = styled("div")({
  display: "flex",
  flexDirection: "column",
  alignItems: "center",
  backgroundColor: "white",
  height: "calc(100vh - 107px)",
  position: "relative",
  borderRadius: "40px",
  padding: "25px",
  margin: "5px",
  boxShadow: "0px 0px 5px #999999",
});
const handleAccordion = () => {
  const accordion = document.getElementsByClassName("content");
  for (let i = 0; i < accordion.length; i++) {
    accordion[i].addEventListener("click", function () {
      this.classList.toggle("active");
    });
  }
};
const accordion = document.getElementsByClassName("content");
for (let i = 0; i < accordion.length; i++) {
  accordion[i].addEventListener("click", function () {
    this.classList.toggle("active");
  });
}

const Organizations = () => {
  return (
    <Wrapper>
      <h2 styled={{ padding: "5px", margin: "10px" }}>Organizations</h2>
      <div className="accordion">
        <div className="organization-name">FCI Assiut University</div>
        <div className="content">
          <span>Operating System</span>
          <span>Data Structures</span>
        </div>
      </div>
    </Wrapper>
  );
};

export default Organizations;
